INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "お！\nあそこに困ってそうな人発見！", 1, 0, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 2, "春咲 ひより", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "大切な人を\n守れるようになりたい…って", 1, 0, 1002, "みんなみたいに\nわたしも強くならなきゃ", 1, 2, "草野 優衣", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "キミに必要な集中力と感性が", 1, 0, 1003, "フェンシングを始めてみては？", 1, 2, "士条 怜", "少しは磨かれると思いますよ。", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "今日はなにして遊ぶ？", 1, 0, 1004, "ねぇ、にいちゃん！", 1, 2, "穂高 みそぎ", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ねぇ…", 1, 0, 1006, "風宮あかりです", 1, 2, "風宮 あかり", "私といっしょに…\nいかない？", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "プリンたべたいのー", 1, 0, 1007, "出雲宮子なのー", 1, 2, "出雲 宮子", "食べ物の恨みは怖いのー", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1, 0, 1008, "ボクは虹村雪。", 1, 2, "虹村 雪", "いいよ。\n見られることは運命さ…", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1, 0, 1009, "フッ…聞いて後悔するがいい！", 1, 2, "柊杏奈", "人呼んで「疾風の冥姫」!!", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1, 0, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 2, "姫宮 真歩", "ほんまおおきにやわ～♪", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1, 0, 1011, "衣之咲璃乃です！", 1, 2, "衣之咲 璃乃", "ここで会ったが\n100年目～！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ち、超能力って…\n何のことかな～？", 1, 0, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 2, "柏崎 初音", "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "一応カリスマ読モJKやってまっす！", 1, 0, 1016, "ちょす！\n美波鈴奈だよ～♪", 1, 2, "美波 鈴奈", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "東京は遊園地みたいなところさー", 1, 0, 1017, "はいたーい。\n喜屋武香織さー。", 1, 2, "喜屋武 香織", "でも、沖縄もとってもいいとこさー", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1, 0, 1018, "支倉伊緒です。", 1, 2, "支倉 伊緒", "イオちゃんって呼んでね。", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1, 0, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 2, "茜 ミミ", "ミミをおいてかないでぇ～", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "あの……\nふぇ……", 1, 0, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 2, "栗林 くるみ", "ふぇぇぇぇぇん……", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1, 0, 1022, "風宮よりです。\nあああああ！", 1, 2, "風宮 より", "なんてありがとうございます！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "おにいちゃんどこいくの？\nえ？", 1, 0, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 2, "北条 綾音", "私こっち行きたいー\nね、早く早くー", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1, 0, 1025, "わっ…わっ…私、\n天野すずめといいます！", 1, 2, "天野 すずめ", "これて何か違う…\nあああすみません！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "あなたは…運命の……\n伴侶……", 1, 0, 1027, "……クスクス…私は\n…倉石恵理子……", 1, 2, "倉石 恵理子", "離しませんわ………\n絶対に…!!", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1, 0, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 2, "佐々木 咲恋", "…そうでしょ？？", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1, 0, 1029, "桜井望だよ！\nよろしくねっ", 1, 2, "桜井 望", "あはは、\n私もまだまだだなぁ～", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1, 0, 1030, "デケデケデンっ！", 1, 2, "ニノン・ジュベール", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1, 0, 1031, "上喜しのぶです。\n手元のドクロが父です。", 1, 2, "上喜 しのぶ", "おかしいですね……", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "けんども\nそれには足りないモンが…", 1, 0, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 2, "野戸まひる", "そう、\nオラのボケに突っ込める相方が…！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ちょっと緊張しちゃって…", 1, 0, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 2, "綾瀬 ゆかり", "ちょ\nちょっと一杯飲んできます…！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "知らない人とは話しちゃいけないので", 1, 0, 1036, "氷川鏡華…です", 1, 2, "氷川 鏡華", "これ以上お話しすることは…\nないです！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "……あ、アラーム。", 1, 0, 1038, "柏崎…栞です。", 1, 2, "柏崎 栞", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "私、一人も友達がいなくて……", 1, 0, 1040, "ふ、双葉碧です。", 1, 2, "双葉 碧", "野に咲く花が、\n唯一の話相手です。", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1, 0, 1042, "三角千歌です。", 1, 2, "三角 千歌", "そう思っています。", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "あぁ？\nお前のそいつの仲間か？", 1, 0, 1043, "安芸真琴だ。", 1, 2, "安芸 真琴", "う、疑ってすまなかったな…", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "生けとし生ける全ての者よ！", 1, 0, 1044, "わらわこそは夜を総べる者！", 1, 2, "イリヤ・オーンスタイン", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "ぐふふふふ……はっ！", 1, 0, 1045, "そこで騎士は妖精を乱暴に……", 1, 2, "遠見 空花", "ｌク、クウカに何かご用ですか!?", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1, 0, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 2, "宮坂たまき", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "それでは早速クエストに…", 1, 0, 1048, "大神美冬よ！", 1, 2, "大神 美冬", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "クエストもバトルも\n掃除も洗濯も", 1, 0, 1049, "星野静流だよ！", 1, 2, "星野静流", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "見ての通りの\nセクシー美少女で", 1, 0, 1050, "アタシは玉泉美咲。", 1, 2, "玉泉美咲", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.4, 0, 0, "？？？？", 1, 0, 1052, "？？？", 1, 2, "リマ", "？？？？", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1053, "モニカ・ヴァイスヴィントだ。", 1, 2, "モニカ・ヴァイスヴィント", "そ、そこまでいうなら\nもらってやる", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1058, "モニカ・ヴァイスヴィントだ。", 1, 2, "ペコリーヌ", "そ、そこまでいうなら\nもらってやる", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1059, "モニカ・ヴァイスヴィントだ。", 1, 2, "コッコロ", "そ、そこまでいうなら\nもらってやる", 1, 0, 0);
INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES (1.5, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1, 0, 1060, "モニカ・ヴァイスヴィントだ。", 1, 2, "キャル", "そ、そこまでいうなら\nもらってやる", 1, 0, 0);
